import React from "react";

const MyAccordion = ({ question, answer }) => {
  return (
    <>
      <div className="main-div">
        <p>+</p>
        <h1>{question}</h1>
      </div>
      <p>{answer}</p>
    </>
  );
};
export default MyAccordion;
